"({ isEnd, direction, distX }) => {
    if (this._translateBeforeSwipe === undefined) {
      this._translateBeforeSwipe = this._getCurrentTranslateValue()
    }

    this._changeTranslateOfAllChildren({
      x: distX + this._translateBeforeSwipe
    })

    if (isEnd) {
      if (direction === 'RIGHT' && this.index !== 0) {
        this._previous()
      } else if (
        direction === 'LEFT' &&
        this.index < this.children.length - 1
      ) {
        this._next()
      } else {
        this._changeTranslateOfAllChildren({ x: this._translateBeforeSwipe })
      }
      this._translateBeforeSwipe = undefined
    }
  }"

